import React from 'react';


const PrivacyPolicy = () => {
  return (
    <div>

      <h1>Privacy Policy</h1>
      <p>Your privacy matters to Voyease Solutions (the “Company”, “we”, “Voyease”, “us” or “our”).

This Privacy Policy (“Policy”) describes the policies and procedures on the collection, use, processing, storage, retrieval, disclosure, transfer, and protection of your information, including personal information and sensitive personal data or information (“Information”), that Voyease may receive through your online access, interaction or use, of the Voyease mobile applications (“Voyease App”) or our website located at https://www.voyease.in (the website and Voyease App are collectively referred to as the “Voyease Platform”) or through your offline interaction with us including through mails, phones, in person, etc., or while availing our Services.</p>
      
    </div>
  );
};

export default PrivacyPolicy;
